import React from 'react';

import './Card.css';

const card = (props) => (
    <article className="Card">
        <ul>
            <li>Account ID:{props.accountId }</li>
            <li>First Name:{props.firstName }</li>
            <li>Last Name:{props.lastName}</li>
            <li>Age:{props.age}</li>
        </ul>

        {/* <div className="Info">
            <div className="Author">{props.author}</div>
        </div> */}
    </article>
);

export default card;
